【wasser13】wasser LEDセンサーライト<br>
<br>
オシャレな屋内用LED人感センサーライト。<br>
電池不要、コンセントに差すだけで自動的に充電。<br>
暗い場所で動きを感知するとライトが自動的に点灯・約20秒で消灯。<br>
フロントライト・ヘッドライトの切替可能、ライトの取り外しも出来るので懐中電灯としても使える。<br>
コンセントからの給電が切れると自動的に点灯するので停電時の非常灯として。<br>
玄関・廊下・リビング・キッチン・トイレなど様々な場所に使えます。<br>
LEDライトなので省電力で長寿命とってもエコに節電対策！<br>
<br>
【特徴】<br>
・オシャレな屋内用人感センサーライト。<br>
・電池不要のコンセント充電式。<br>
・暗い場所でセンサーが作動！動きを感知して自動点灯・自動消灯。<br>
・ホルダーと本体はセパレート式なので取り外して持ち歩きOK。懐中電灯として使える。<br>
・停電などでコンセントからの給電が切れると自動的に点灯。<br>
・消費電力は最大約1.8W。<br>
<br><br>
白いボディと曲面がオシャレでスタイリッシュなLEDセンサーライト。<br>
充電式なのでコンセントに差し込むだけで簡単に使用できます。<br>
玄関・廊下・階段・リビング・クローゼットなどにオススメ。<br>
通常のセンサーライトとして活躍するフロントライト、緊急時などに懐中電灯として使えるヘッドライトの2WAY。<br>
暗い場所で動きを感知するとセンサーが作動して自動的に点灯、約20秒で消灯します。<br>
<br>
LEDライトは白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
ハンディサイズのセンサーライトなので<br>
重さはホルダーを合わせて約190g、持ち運びも簡単です。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
規格<br>
サイズ：最大約H133×W60×D55mm<br>
電源：AC100V 50Hz/60Hz <br>
フル充電時間：約8～10時間<br>
連続使用時間：<br>
フロントライト/約2時間<br>
ヘッドライト/約1.5時間<br>
センサー感知距離：約3mまで（設置環境や明るさによります。）<br>
消費電力：最大約1.8W <br>
内蔵バッテリー：リチウムイオン電池 3.7V/500mA<br>
光源：<br>
フロントライト/白色LED×16灯<br>
ヘッドライト/白色LED×2灯<br>
照度(高さ30cm)：<br>
フロントライト/約240Lux<br>
ヘッドライト/約1200Lux<br>
重さ：約190g<br>
