<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ライト・照明

Bun Bun eco light ブンブンエコライト<br>
<br>
"楽しい手回し充電！エコでカラフルなLEDライト"<br>
BunBun eco lightは、ブンブン振り回して充電するおしゃれでエコロジーなLEDライト。<br>
キャンプやアウトドアで便利に使えるLEDライトです。<br>
いつでもどこでも簡単に充電でき、使いたいときに電池切れといったトラブルがありません。<br>
<br>
■30秒回すだけで5分間点灯！<br>
ライト部分を引き出して「ブンブン」軽く振り回すだけで誰でも簡単に充電できます。<br>
<br>
■電気二重層コンデンサスーパーキャパシタ採用！<br>
 使用可能回数が10万回以上と長寿命。<br>
<br>
■アウトドアや野フェスにぴったり！<br>
わずか重さ97gと大変軽いので、リュックに付けたりベルトに付けたりとファッションアイテムとしても楽しめます。<br>
<br>
■長期保管も安心なので防災用品としても最適！<br>
 長期保管した場合の電池の液漏れ、いざという時に充電できないようなトラブルがありません。<br>
 長期保管に優れた電気二重層コンデンサのため、防災用としても最適です。<br>
<br>
 ＜製品仕様＞<br>
・バッテリー:手動充電式 電気二重層コンデンサ(スーパーキャパシタ)<br>
・外形寸法:直径4cm×長さ14cm（伸ばした状態22cm）<br>
・重量:97g<br>
・材質：ABS/アクリル樹脂<br>
・付属品:ストラップ1本<br>
<br>
BunBun eco light Q&A<br>
<br>
Ｑ．どのように充電するのですか？<br>
ライト部分を本体から引き出し、直角に曲げます。<br>
その後、ライト部分を持って回すだけで簡単に充電ができます。<br>
<br>
Ｑ．電池は必要ですか？<br>
 本体を振り回すことにより、内蔵されたコンデンサが発電する仕組みなので電池は必要ありません。<br>
<br>
Ｑ．電球は交換できますか？<br>
 電球の交換はできません。<br>
<br>
Ｑ．どれくらい回せばいいのですか？<br>
 約30秒回せば約5分間点灯します。<br>
但し、それ以上回し続けても点灯時間は延びません。<br>
<br>
Ｑ．充電する時は右回転ですか？左回転ですか？<br>
どちらに回しても充電できますので、回しやすい方向でお使い下さい。<br>
<br>
Ｑ．電源の寿命はどれくらいですか？<br>
 電源に電気二重層コンデンサ(スーパーキャパシタ)を採用しているため、10万回以上の使用が可能です。<br>
<br>
Ｑ．雨に濡れても大丈夫ですか？<br>
 防水機能はありませんので、水に濡らさないようにご使用下さい。<br>
